const express = require("express");
const url = require("url");
const auth = require("../middleware/auth");
const Item = require("../models/item.model");

const itemRouter = express.Router();

itemRouter.post("/add", async (req, res) => {
  const item = new Item({
    ...req.body,
  });

  try {
    const PhotoByteArray =
      "data:image/jpeg;base64,";
    item.PhotoByteArray = PhotoByteArray;
    await item.save();
    res.status(201).send({ item, message: "SUCCESS" });
  } catch (e) {
    res.status(400).send({ e, message: "error" });
  }
});

itemRouter.get("/getall", async (req, res) => {
  const itemName = req.query.ItemName;
  const regex = new RegExp(itemName, "ig");
  try {
    const items = await Item.find({
      ItemName: regex,
    });
    res.status(200).send(items);
  } catch (e) {
    res.status(400).send(e);
    console.log(e);
  }
});

module.exports = itemRouter;
